import React from "react";
import { BoundingBoxContainer } from "./facerecognition.styles";
const FaceRecognition = ({ imageUrl, box }) => {
  return (
    <>
      <div className="absolute mt2">
        <img
          id="inputimage"
          src={imageUrl}
          alt=""
          width="500px"
          height="auto"
        />
        <BoundingBoxContainer style={{}}></BoundingBoxContainer>
      </div>
    </>
  );
};

export default FaceRecognition;
